export default(s,r)=>{const e=document.querySelector(s),t=document.querySelector(r);let n=e.value;e.addEventListener("change",function(){if(e.value===n)return;console.log("wefwef",e.value);const o=new URL(window.location.href);n=e.value,o.searchParams.set("tenant",n),t.disabled=!0,fetch(o).then(a=>a.text()).then(a=>{const c=new DOMParser().parseFromString(a,"text/html").querySelector(r);t.innerHTML=c.innerHTML||"",t.options[0].dataset.value=e.options[e.selectedIndex].dataset.value,t.disabled=!1,t.dispatchEvent(new Event("change"))})}),e.dispatchEvent(new Event("change"))};
